  false,\n\t\"url\": null,\n\t\"notes\": \"The MODIS Vegetation Indices Version 6
  product provides a Vegetation Index (VI) value at a per pixel basis. There are 2
  primary vegetation layers. The algorithm for this product chooses the best available
  pixel value from all the acquisitions from the 16 day period. The criteria used
  is low clouds, low view angle and the highest NDVI/EVI value. The first is the Normalized
  Difference Vegetation Index (NDVI), which is referred to as the continuity index
  to the existing National Oceanic and Atmospheric Administration-Advanced Very High
  Resolution Radiometer (NOAA-AVHRR) derived NDVI. The second vegetation layer is
  the Enhanced Vegetation Index (EVI), which has improved sensitivity over high biomass
  regions. Information on each individual MODIS Vegetation Indices Product along with
  improvements/changes for Version 6 are available at: https://lpdaac.usgs.gov/dataset_discovery/modis_products_table.\",\n\t\"license_title\":
